export class ProgressBarReporter {
    constructor() {
        this.running = false;
        this.current = {
            optProgressBar: null,
            total: 0,
            startValue: 0,
        };
    }
    async start(name, optProgressBar, total, startValue, payload, progressBarPreset) {
        this.current = {
            optProgressBar,
            total,
            startValue,
            payload,
            progressBarPreset,
        };
        this.running = true;
    }
    async update(current, payload) { }
    async stop(name) {
        this.running = false;
        return name;
    }
    async completed() {
        this.running = false;
    }
}
